const testFuncs = require('../src/1044.longest-duplicate-substring.js')
describe.each(
  Object.entries(testFuncs)
)('%s', (_, testFunc) => {
  it('case 1', () => {
    expect(testFunc('banana')).toEqual('ana')
  })
  it('case 2', () => {
    expect(testFunc('')).toMatch(/(ijkz|akyj)/)
  })
  it('case 3', () => {
    expect(testFunc(
      ''
    )).toEqual(
      ''
    )
  })
})
